import requests

url = "https://youtube-v3-alternative.p.rapidapi.com/video"
querystring = {"id": id}

headers = {
    "X-RapidAPI-Key": "SIGN-UP-FOR-KEY",
    "X-RapidAPI-Host": "youtube-v3-alternative.p.rapidapi.com"
}

response = requests.get(url, headers=headers, params=querystring)

print(response.json())

